        public ICollection<RecommendedProduct> GetProductRecommendations(int productId)
        {
            return Recommendations
                .Where(kvp => kvp.Key == productId)
                .Select(kvp => kvp.Value)
                .DefaultIfEmpty(new List<RecommendedProduct>())
                .Single();
        }

        [SuppressMessage("Microsoft.Performance", "CA1822:MarkMembersAsStatic", Justification = "This code needs to be called from instances of this class through an interface.")]
        public bool ProductExists(int productId)
        {
            return Recommendations.Any(kvp => kvp.Key == productId);
        }
